import React from 'react'
import Cards from '../Cards'
import MainSection from '../MainSection'
import './home.css'


function Home() {

    
    return (
        <div>
            <MainSection/>
            <Cards 
                    status = {true}
                    url = {`get/${5}`}
                />
                <CardItem 
                            src={`http://localhost:8989/api/${oneP.productImage}`} 
                            text={`${oneP.description}`}
                            label='Adventure' 
                            path='/servise' 
                            title={`${oneP.title}`} 
                            likes={`${oneP.likes}`}
                            id = {`${oneP._id}`}
                        /> 
        </div>
        
    )
}

export default Home

